@edelaye and @natke  - I was able to build onnxruntime on zcu102 using this script https://github.com/centennialsoftwaresolutions/vitis-ai-tutorial-helper-files/blob/main/install_onnxruntime_zcu102.sh

But as soon as I ran the vitisai-execution provider with this script (use any argument to make it run with vitisai instead of CPU) https://github.com/centennialsoftwaresolutions/vitis-ai-tutorial-helper-files/blob/main/compile_onnx_model.py. I got a Index out of bounds error.

Not sure if I'm just doing something wrong or if there is a bug in onnxruntime with vitis ai.
